import React from 'react';
import moment from 'moment';
import Details from '../Details';

const openModal = (row) => {
  <Details props={row}/>
  // console.log(row);
  // alert(row);
  // if (list) {
  //   setSelectedList(list)
  // }
  // setModalStatus(true);
  // getTargetConfigurationList();
}
export default function RenderAllocationFileListTable(props) {




  let response = [];    
  if (props.data.length <= 0) {
    response.push(
      <tr key="1">
        <td colSpan="12">No Data</td>
      </tr>
    )
  } else {
    response = props.data.map((row, index) => (
      <tr key={index}>
        <td>{index + 1}</td>
        <td>{row.fgCode}</td>
        <td>{row.buyBackType}</td>
        <td>{row.distributer}</td>
        <td>{row.outlet}</td>
        <td>{moment(row.fromDate, "YYYY-MM-DD").format("DD-MM-YYYY")} - {moment(row.toDate, "YYYY-MM-DD").format("DD-MM-YYYY")}</td>
        <td>{(row.status == 'ACTIVE') ? (<span className="text-success">{row.status}</span>): row.status }</td>
        <td>
          <div className="d-flex">
            <button className="btn-action btn-action-active">

            <i className="fa fa-pencil" aria-hidden="true"  ></i>
              {/* <i className="fa fa-pencil" aria-hidden="true"   ></i> */}
            </button>
            <button className="btn-action btn-action-active">
              <i className="fa fa-eye" aria-hidden="true"  onClick={() => openModal(row)}></i>
            </button>
          </div>
        </td>
      </tr>
    ))
  }
  return (
    response
  )
}
